ctsHolder(); DOCS_initialLoadTiming = KX_kixApp.getInitialLoadTiming(); KX_getLatencyStats = function() {return KX_kixApp.getPerformanceManager().getInitialLoadStats();}; KX_resize = function() {KX_kixApp.resize();}; _docs_annotate_getAnnotatedText = function(id) {return KX_kixApp.getAnnotatedText(id);};}KX_startKix(); DOCS_initialLoadTiming.setTime('al'); DOCS_initialLoadTiming.setTime('eac');</script><script nonce="k_eEgbM3XKOrZ2lSOrpq3A">DOCS_warmStartDocumentLoader.startLoad( 9373.0 ,'eGTCNMstOqegIw', 45.0 , 0.0 ,[45,""], null , null ); var DOCS_modelChunkLoadStart; var DOCS_modelChunkParseStart; var DOCS_modelChunk;</script><script nonce="k_eEgbM3XKOrZ2lSOrpq3A">DOCS_modelChunkParseStart = new Date().getTime();</script><script nonce="k_eEgbM3XKOrZ2lSOrpq3A">DOCS_modelChunk = {"chunk":[{"ty":"is","ibi":1,"s":"In as many words\n\nTo love and be loved.\n\nWhat I\u0027m looking for\n\nA deeper understanding and a genuine human connection. \n\nA relationship which should last a lifetime, and children, who I would like to see grow old.\n\nA bit about me\n\nI\u0027ve probably done all of my imbibing, but when I do, I tend to have a cigarette. I don\u0027t do drugs. I like walking and running, and I\u0027m thankful for my health. I can drive, but don\u0027t. I\u0027ll be moving into a home I\u0027ll actually own sometime in the future.\n\nI\u0027m learning to play the piano and hope to become quite proficient at it. I cook a lot, and don\u0027t mind vegetables in the slightest. I\u0027m fascinated by physics, yet barely understand. I believe consciousness is a lot like a colour - entirely subjective.\n\nCan\u0027t survive without music: Floating Points, Risn Murphy, Daniel Avery, HAIM, Kelly Lee Owens, HAAi, Ezra Collective, Lee Bong Geun, Mozart.\n\nReading: Tom Robbins, David Mitchell, Iain Reid, Phillip K. Dick, Cixin Liu, Haruki Murakami.\n\nFilm: Wes Anderson. And his complementary polar, Roy Andersson. Luc Besson, Guillermo del Toro, Coen brothers.\n\nTV: Mad Men, The Office (only seen American), The Good Place, Gogglebox, Big Brother.\n\nWhat I\u0027m looking for\n\nA woman of the world. Who has a real flair - instruments, languages, knowledge, conversation. Who blossoms rather shies away. An assuredness in herself - and I certainly don\u0027t want to be in competition! I\u0027d prefer it if we talked with one another, and that we did this more than we talked about one another.\n\nA lot more important than all of that, is a load of love and care.\n\nI haven\u0027t exactly had an easy time in this world. I wouldn\u0027t want to dwell, but I\u0027ve missed a lot of the joy and happiness. So to be reminded of such is a real treasure for me.\n\nA bit more about me\n\nI find it difficult to do some of the social aspects - which everyone else seems to be able to do - such as, to keep on top/point with the collective discussion; or find the relative clause with the fulcrum in a conversation. I\u0027d probably be a bit better at it if there weren\u0027t the games, though. I haven\u0027t been diagnosed with autism.\n\nI\u0027m a bit of a realist, swaying towards the negative, but idealistic.  An empire is only in a mind!  A pensive deliberator, holistic narrator, where the only aim is to make sense and better understand. Physics is literally everything\n\nThe funniest part about physics is that it\u0027s not magic.\n\nI\u0027m not that serious! I flunk every test, simply because I can If I\u0027m being told, I need to ask I\u0027m about as competitive as a wet sock... \n\nI hate conflict, but, even still, I could argue until the end of time - I just don\u0027t see the point! I don\u0027t hold any deep-seated beliefs - about this, or that. I think it\u0027s healthy to formulate an opinion, and especially, to care. I\u0027m tired by the general discourse. Politics is literally everything\n\nOnly when humankind brings to an end the endeavour for prosperity, and instead works for the good of humanity, shall we truly prosper and realise wealth.\n\nOr, as I see it, today...\n\nWhen everyone is fooling everyone, everyone is a fool.\n\nDreams and aspirations\n\nA job is a job for me. When I dream about my ideal home, it\u0027d be supportive and positive. Lots of time for one another.\n\nA relationship needs to be tender. I have endless patience, care and concern for the right woman.\n\nA side note\n\nWe are no more intelligent than, even our earliest ancestors, we simply know more. Our evolution benefits from cooperation, as much as competition, if not more so by cooperation.\n\nI feel, if you spend enough time with a person, you get to know one another, becoming forgiving, inclined, adaptable, agreeable, aligned and assured by them. You grow around one another, in any relationship, community, team, job and life. I\u0027d only hope that we grow together.\n\n\n**"},{"ty":"is","ibi":3806,"s":"\u0003\n"},{"ty":"as","st":"document","si":0,"ei":0,"sm":{"ds_pw":595.4399999999999,"ds_lhs":1,"ds_ulhfl":false,"ds_hi":"kix.mjsyh5amt6us","ds_ph":841.68}},{"ty":"ae","et":"inline","id":"kix.iqga9ae0n7jo","epm":{"ee_eo":{"eo_bo":{"ln_s":0,"ln_w":0.0,"ln_c2":{"hclr_color":"#000000","clr_type":0}},"i_pid":null,"eo_mb":9.0,"i_ht":226.0,"eo_rtdf":{"rdf_ft":0},"eo_ml":9.0,"eo_mr":9.0,"eo_ad":null,"i_cid":"s-blob-v1-IMAGE-4obw6yGc1-g","i_cont":0.0,"eo_mt":9.0,"eo_type":0,"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":"","lc_srk":""},"i_wth":451.27559055118115,"eo_at":null,"i_iwc":{"iwc_w":false},"eo_hb":false,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_iw":false,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"i_bri":0.0,"i_msct":0,"i_src":"","i_opa":1.0}}},{"ty":"ae","et":"inline","id":"kix.kagslrvf9vjk","epm":{"ee_eo":{"eo_bo":{"ln_s":0,"ln_w":0.0,"ln_c2":{"hclr_color":"#000000","clr_type":0}},"i_pid":null,"eo_mb":9.0,"i_ht":530.0,"eo_rtdf":{"rdf_ft":0},"eo_ml":9.0,"eo_mr":9.0,"eo_ad":null,"i_cid":"s-blob-v1-IMAGE-Tituz5MKZb0","i_cont":0.0,"eo_mt":9.0,"e
